import * as React from "react";
import { render } from "react-dom";
import { Frame, Scroll } from "framer";
// import "./styles.css";

function GridHorizontal() {
  return (
    <Scroll direction="horizontal" width='100%' height={150} radius={30}>
      <Frame width='12em'  height='12em' radius={20} background={"#fff"} />
      <Frame width='12em'  left='13em' height='12em' radius={20} background={"#f5f7f7"} />
      <Frame width='8em'  left='26em' height='12em' radius={20} background={"#fff"} />
      <Frame width='21em'  left='34em' height='12em' radius={20} background={"#00db67"} />
      <Frame width='6em'  left='51em' height='12em' radius={20} background={"#fff"} />
      <Frame width='12em'  left='68em' height='12em' radius={20} background={"#c8c8c8"} />

    </Scroll>
  );
}
export default GridHorizontal;
